content.css:
.dropdown {
  min-width: 250px;
  height: 45px;
  border: 0.5px solid #D9D2ED;
  opacity: 1;
  font-size: 23px;
  color: #333333;
}
.dropdown,
.dropdown:hover {
  border: 1px solid black;
}
.chart-wrapper {
  position: relative;
  color: #FFFFFF;
  display: flex;
  gap: 4rem;
  align-items: center;
}
.chart-wrapper .chart-divider {
  position: absolute;
  z-index: -1;
  width: 100%;
  height: 2px;
  background: black;
}
.chart-wrapper .vertical-line-top {
  position: absolute;
  right: 0;
  bottom: -30%;
  width: 2px;
  height: 4rem;
  background: black;
}
.chart-wrapper .vertical-line-top-1 {
  position: absolute;
  left: 0;
  bottom: -30%;
  width: 2px;
  height: 4rem;
  background: black;
}
.chart-wrapper .vertical-line-bottom {
  position: absolute;
  right: 0;
  top: -30%;
  width: 2px;
  height: 4rem;
  background: black;
}
.chart-wrapper .vertical-line-bottom-1 {
  position: absolute;
  left: 0;
  top: -15%;
  width: 2px;
  height: 4rem;
  background: black;
}
.chart-wrapper .rectangle-box {
  margin: 0.5rem 0;
  width: 18.5rem;
  min-height: 4rem;
  background: #3A6AE0;
}
.chart-wrapper .rectangle-box .content {
  text-align: center;
  font-size: 18px;
}
.chart-wrapper .square-box {
  margin: 0.5rem;
  width: 3rem;
  background: red;
}
.chart-wrapper .circle-card {
  position: relative;
  box-sizing: border-box;
  background: #FF8B00;
  border-radius: 50%;
  min-width: 200px;
  min-height: 200px;
  display: flex;
  justify-content: center;
  align-items: center;
}
.chart-wrapper .circle-card .vector-x {
  position: absolute;
  z-index: -1;
  width: 330px;
  height: 2px;
  background: black;
}
.chart-wrapper .circle-card .vector-y {
  position: absolute;
  top: -80px;
  z-index: -1;
  width: 2px;
  height: 90px;
  background: black;
}
.chart-wrapper .circle-card .content {
  font-weight: bold;
  font-size: 18px;
  text-align: center;
  color: black !important;
}
.chart-wrapper .circle-card .square-box-of-circle-card {
  position: absolute;
  top: -6rem;
  left: 0;
  min-width: 200px;
  background: #FF8B00;
  padding: 0.5rem 0;
}
.chart-wrapper p {
  text-align: center;
  font-size: 12px;
  font-weight: bold;
}


